import React, { useState, useEffect } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import InputCollaborateur from './components/inputCollaborateur';
import Rh from './components/rh'
import Home from './components/home'
import Redirection from './components/redirection'
import axios from 'axios'

function App() {

  const [dataGestionPersonnel, setDataGestionPersonnel] = useState([])

  useEffect(() => {
    const fetchDataGestionPersonnel = async () => {
      const result = await axios.get(
        'http://localhost:3000/gestionPerso',
      );
      console.log(result, 'USERGESTIONPERSO');

      setDataGestionPersonnel(result.data);
    };
    fetchDataGestionPersonnel();
  }, []);


  return (
    <Router>
      <div>
        <Switch>
          <Route exact path='/'><Home /></Route>
          <Route exact path='/redirect/:email'><Redirection /></Route>
          <Route exact path='/collaborateur/:prenom/:nom'><InputCollaborateur /></Route>
          <Route exact path='/rh'><Rh /></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
